INSERT INTO `DIPLOME` VALUES (1,'Master Professionnel d\'Informatique. IUP d\'Informatique Décsionnelle et Statistique, Parcours Ingénierie Informatique de la Décision et de l\'Evaluation Economique.','I.I.D.E.E.','Laboratoire ERIC, Batiment L, 5 Avenue Pierre Mendès France CP 11, 69676 BRON Cedex','http:/dis.univ-lyon2.fr/iidee/','Les entreprises, tout comme les autres organismes sociaux fonctionnels, sont des entités complexes, ouvertes sur un environnement évolutif, avec lequel elles ont de multiples interactions. Ces systèmes sociaux sont ainsi faits qu\'y apparaissent de façon récurrente des situations problématiques complexes (et non pas seulement compliquées) auxquelles les décideurs doivent faire face du mieux possible sachant que, en situation complexe, la décision est multicritère.Or il existe actuellement une sorte de \'déficience résolutive\' vis à vis de la complexité. Si l\'on sait faire face à des situations dans lesquelles cause et effet sont proches dans le temps et dans l\'espace on est désarçonné lorsqu\'il existe entre ces termes des décalages spatiaux et temporels, d\'autant plus que les relations mises en jeu sont non linéaires. Face à cet état de chose nous proposons, dans le cadre du DESS IIDEE, un programme d\'enseignements permettant de définir une série de règles de comportement pour les décideurs (une <<heuristique>>), augmentant la probabilité d\'arriver à une décision <<satisfaisante>> (et non pas <<optimale>> puisque l\'on raisonne en termes multicritères). Fondamentalement, nous voulons former des cadres spécialistes de la formalisation du processus de décision. Nous entendons fournir à ces cadres des méthodologies et des outils permettant : d\'analyser et de modéliser les stratégies des décideurs, de trouver les réponses les plus adéquates à des problèmes apparaissant dans un contexte donné, d\'évaluer les impacts des actions envisagées, tant au sein de l\'institution que dans son environnement.','','04 78 77 23 77','Valerie.Gabriele@univ-lyon2.fr','omar.boussaid@univ-lyon2.fr','sylvestr@gate.cnrs.fr','Le recrutement est décidé par le Conseil Pédagogique (C.P.) du DESS, composé d\'enseignants titulaires et de professionnels. Le choix des candidats est fait en fonction de leur niveau académique (ou de leur expérience professionnelle) et de leur projet personnel. En ce qui concerne les éventuels candidats \'demandeurs d\'emploi\' non titulaire d\'une maîtrise (voir liste ci-dessous), ils doivent justifier d\'un niveau académique (bac + 2 années) et d\'une expérience professionnelle minimum (6 ans). Maîtrise d\'économétrie, économie ou gestion, Maîtrise d\'Informatique, ou d\'Informatique Appliquée à la Gestion, Maîtrise de Mathématiques, ou de Mathématiques Appliquées aux Sciences Sociales ou tout autre formation scientifique (bac+4) comportant de solides connaissances en informatique, mathématiques appliqués et économie.','Il est prévu que le DESS accueillera 25 étudiants par promotion dont 5 environ pourront être des professionnels (formation continue, recherche d\'emploi,...)','Les candidats retenus, après examen des dossiers, sont auditionnés soit au mois de Juillet soit au mois de Septembre. Une liste des candidats admis à suivre le DESS est constituée, ainsi qu\'une liste d\'attente destinée à pallier les défections éventuelles.',NULL);
/*!40000 ALTER TABLE `DIPLOME` ENABLE KEYS */;
UNLOCK TABLES;

